// import React, { useEffect, useState } from 'react';
import { getOrdenes, getOrdenesDeleted, postDeleteOrden, postRecoverOrden } from "../../Utils/Orden";
// import Listar from "../Listar";
import DetailOrden from "./DetailOrden";

import CreateTable from '../Partials/CreateTable';

export default function OrdenTablaActivos(props) {
    const { changeFrame } = props;
    return (
        <CreateTable
            fetchGet={getOrdenes}
            fetchDelete={postDeleteOrden}
            title="Ordens"
            DetailComponent={DetailOrden}
            changeFrame={changeFrame}
            id="id"
            table={[
                { column: "Vehiculo", filter: ["vehiculo", "patente"], row: ["vehiculo", "patente"] },
                { column: "Cliente nombre", filter: ["cliente", "nombre"], row: ["cliente", "nombre"] },
                { column: "Cliente apellido", filter: ["cliente", "apellido"], row: ["cliente", "apellido"] }]}

            vocabulary={{
                singular: "orden",
                id: ["id"],
                pronombre: "la"
            }} />
    );
};
